import "../styles/home.css";
import MenuItem from "../components/MenuItem";
// import "../assets/happy.png";

const Home = () => {
  return (
    <div>
      <div className="Topbar">
        <svg viewBox="10 0 50 80">
          <text y="50">Dog's Club</text>
        </svg>
      </div>
      <div className="Sidebar">
        <MenuItem title="Home" image={require("../assets/home.png")}/>
        <MenuItem title="Dogs" image={require("../assets/happy.png")} navigatesTo="Register"/>
      </div>

      <div className="contentContainer">
        <div className="headContent" />
        <div className="mainContent">
          {/* <button onClick={getClip}>Hello</button> */}
          <input
            type="text"
            placeholder="Your clipboard here.."
            className="textBox"
          />
        </div>
        <div className="footerContent" />
      </div>
    </div>
  );
};

export default Home;
